"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[3002],{3340:n=>{n.exports=JSON.parse('{"label":"introduction","permalink":"/tags/introduction","allTagsPath":"/tags","count":11,"items":[{"id":"learning/biology/index","title":"Biology","description":"To know about Biology, it\'s important to have a good understanding of General Science, Chemistry, Physics, Statistics, and Math.","permalink":"/learning/biology/"},{"id":"learning/data-mining/index","title":"Data Mining","description":"\u9019\u662f\u6210\u529f\u5927\u5b78\u8cc7\u8a0a\u5de5\u7a0b\u5b78\u7cfb\u9ad8\u5b8f\u5b87\u6559\u6388\u6240\u958b\u7684\u8cc7\u6599\u63a2\u52d8\u7684\u8ab2\u7a0b\u7b46\u8a18\u3002","permalink":"/learning/data-mining/"},{"id":"learning/deep-learning/index","title":"Deep Learning","description":"\u9019\u500b\u7b46\u8a18\u5c0d\u61c9 Coursera \u7cfb\u5217\u8ab2\u7a0b Deep Learning\u3002 \u8ab2\u7a0b\u4e3b\u8981\u7531 Andrew Ng \u6559\u6388\u4e3b\u8b1b\uff0c\u662f\u4e00\u500b\u975e\u5e38\u597d\u7684\u6df1\u5ea6\u5b78\u7fd2\u8ab2\u7a0b\u3002","permalink":"/learning/deep-learning/"},{"id":"learning/deep-learning/neural-networks-and-deep-learning/introduction","title":"Introduction","description":"\u9019\u500b\u7ae0\u7bc0\u6703\u4ecb\u7d39 Neural Network \u7684\u6982\u5ff5\uff0c\u4e26\u4e14\u6df1\u5165\u63a2\u8a0e\u70ba\u4ec0\u9ebc Deep Learning \u6b63\u5728\u5982\u6b64\u706b\u71b1\uff0c\u4ee5\u53ca\u4ed6\u53ef\u4ee5\u61c9\u7528\u5728\u90a3\u4e9b\u8cc7\u6599\u4e0a\u3002Deep Learning \u7684\u61c9\u7528\u4e0d\u53ea\u662f\u9650\u65bc Structured Data\uff0c\u4e5f\u53ef\u4ee5\u61c9\u7528\u5728 Audio\u3001Image \u4ee5\u53ca Raw Text \u9019\u4e9b Unstructured Data \u4e0a\u3002\u56e0\u6b64\uff0cDeep Learning \u53ef\u4ee5\u66f4\u6709\u6548\u7684\u5206\u6790\u8cc7\u6599\uff0c\u4e26\u5f97\u5230\u66f4\u52a0\u51c6\u78ba\u7684\u7d50\u679c\u3002\u53e6\u5916\uff0c Deep Learning \u9084\u53d7\u76ca\u65bc\u4e09\u500b\u65b9\u9762\uff1a\u8cc7\u6599\u3001\u904b\u7b97\u4ee5\u53ca\u6f14\u7b97\u6cd5\u3002\u7531\u65bc\u8cc7\u6599\u7684\u6578\u91cf\u4e0d\u65b7\u589e\u52a0\uff0c\u50b3\u7d71\u7684\u5b78\u7fd2\u6f14\u7b97\u6cd5\u5df2\u7d93\u7121\u6cd5\u80fd\u5920\u6eff\u8db3\u61c9\u7528\u7684\u9700\u6c42\uff0c\u800c Deep Learning \u5247\u53ef\u4ee5\u900f\u904e\u4e0d\u65b7\u7684\u64f4\u5927\u7db2\u8def\u67b6\u69cb\u53ca\u8cc7\u6599\u4f86\u63d0\u5347\u6548\u80fd\u3002\u540c\u6642\uff0c\u786c\u9ad4\u7684\u767c\u5c55\u4e5f\u8b93 Deep Learning \u7684\u61c9\u7528\u53ef\u4ee5\u66f4\u52a0\u5ee3\u6cdb\u3002","permalink":"/learning/deep-learning/neural-networks-and-deep-learning/introduction"},{"id":"learning/machine-learning/introduction/introduction","title":"Introduction","description":"\u6a5f\u5668\u5b78\u7fd2\u662f\u4e00\u9580\u6280\u8853\uff0c\u53ef\u4ee5\u8b93\u96fb\u8166\u81ea\u52d5\u5b78\u7fd2\u3001\u6539\u5584\u548c\u81ea\u6211\u6539\u9032\uff0c\u8b93\u96fb\u8166\u7372\u5f97\u77e5\u8b58\uff0c\u800c\u4e0d\u9700\u8981\u660e\u78ba\u7684\u7a0b\u5f0f\u6307\u793a\u3002\u5b83\u6d89\u53ca\u5230\u5169\u7a2e\u4e0d\u540c\u7684\u5b78\u7fd2\uff1a\u76e3\u7763\u5f0f\u5b78\u7fd2\u548c\u7121\u76e3\u7763\u5f0f\u5b78\u7fd2\u3002\u5728\u76e3\u7763\u5f0f\u5b78\u7fd2\u4e2d\uff0c\u6211\u5011\u6703\u5c07\u554f\u984c\u8207\u6b63\u78ba\u7b54\u6848\u4e00\u8d77\u63d0\u4f9b\u7d66\u7a0b\u5f0f\uff0c\u4ee5\u4fbf\u627e\u51fa\u5169\u8005\u4e4b\u9593\u7684\u95dc\u4fc2\u3002\u53ef\u4ee5\u5206\u70ba\u56de\u6b78\u554f\u984c\u548c\u5206\u985e\u554f\u984c\u3002\u800c\u5728\u7121\u76e3\u7763\u5b78\u7fd2\u4e2d\uff0c\u4e0d\u9700\u8981\u77e5\u9053\u8cc7\u6599\u4e2d\u6bcf\u500b\u554f\u984c\u5c0d\u61c9\u7684\u89e3\u7b54\u70ba\u4f55\uff0c\u800c\u662f\u7531\u7a0b\u5f0f\u5f9e\u8cc7\u6599\u4e2d\u627e\u51fa pattern \u548c\u7d50\u69cb\uff0c\u65b9\u6cd5\u901a\u5e38\u70ba\u5229\u7528\u8cc7\u6599\u4e2d\u7684\u8b8a\u6578\u95dc\u4fc2\u9032\u884c\u5206\u7fa4\u6f14\u7b97\u6cd5\uff08clustering algorithm\uff09\uff0c\u4ee5\u53ca Non-clustering algorithm\uff0c\u4e5f\u5c31\u662f Cocktail Party Algorithm\u3002","permalink":"/learning/machine-learning/introduction/"},{"id":"learning/machine-learning/neural-networks/introduction-of-neural-networks","title":"Introduction of Neural Networks","description":"\u795e\u7d93\u7db2\u8def\u662f\u70ba\u4e86\u6a21\u64ec\u4eba\u985e\u7684\u5927\u8166\u904b\u4f5c\uff0c\u5927\u8166\u53ef\u4ee5\u900f\u904e\u4e00\u7a2e learning algorithm \u505a\u5230\u807d\u3001\u8aaa\u3001\u8b80\u3001\u5beb\u7b49\u6d3b\u52d5\uff0c\u800c\u795e\u7d93\u7db2\u8def\u7684\u6700\u5c0f\u55ae\u4f4d\u70ba\u795e\u7d93\u5143\uff0c\u5b83\u53ef\u4ee5\u7531 input wires \u63a5\u6536\u591a\u500b\u8f38\u5165\uff0c\u4e26\u5c07\u8655\u7406\u904e\u7684\u8a0a\u606f\u50b3\u9001\u51fa\u53bb\u900f\u904e output wires\u3002\u6211\u5011\u53ef\u4ee5\u518d\u52a0\u4e0a bias unit \u4f5c\u70ba\u8f38\u5165\uff0c\u800c\u8655\u7406\u9019\u4e9b input \u7684\u70ba sigmoid (logistic) activation function\u3002\u7576\u6709\u591a\u5c64 layer \u6642\uff0c\u7b2c\u4e00\u5c64\u70ba input layer\uff0c\u6700\u5f8c\u4e00\u5c64\u70ba output layer\uff0c\u800c\u4e2d\u9593\u6240\u6709\u7684\u5c64\u7d71\u7a31\u70ba hidden layer\u3002\u6211\u5011\u7d66\u4e88 hidden layer \u7684 nodes \u4e00\u500b\u540d\u5b57\uff1aactivation units\uff0c\u5b83\u662f\u7d93\u7531 input \u548c matrix of weights \u4f5c\u7528 output \u904e\u4f86\u7684\uff0chypothesis \u5c31\u662f\u9019\u4e9b activation units \u7d93\u7531\u6b0a\u91cd\u77e9\u9663\u8207\u8f38\u5165\u77e9\u9663\u76f8\u4e58\u5f8c\u7684\u7d50\u679c\u3002","permalink":"/learning/machine-learning/neural-networks/introduction-of-neural-networks"},{"id":"learning/machine-learning/linear-regression/index","title":"Linear Regression","description":"\u9019\u500b\u7ae0\u7bc0\u6211\u5011\u6703\u4ecb\u7d39\u7dda\u6027\u56de\u6b78\uff0c\u7dda\u6027\u56de\u6b78\u662f\u4e00\u500b\u975e\u5e38\u7c21\u55ae\u7684\u6a5f\u5668\u5b78\u7fd2\u6a21\u578b\uff0c\u4f46\u662f\u5b83\u7684\u61c9\u7528\u537b\u975e\u5e38\u5ee3\u6cdb\uff0c\u4f8b\u5982\uff1a\u80a1\u7968\u9810\u6e2c\u3001\u623f\u50f9\u9810\u6e2c\u3001\u92b7\u552e\u9810\u6e2c\u7b49\u7b49\uff0c\u56e0\u6b64\u7dda\u6027\u56de\u6b78\u662f\u4e00\u500b\u975e\u5e38\u91cd\u8981\u7684\u6a5f\u5668\u5b78\u7fd2\u6a21\u578b\u3002","permalink":"/learning/machine-learning/linear-regression/"},{"id":"learning/machine-learning/logistic-regression/index","title":"Logistic Regression","description":"Classification \u662f\u4e00\u500b\u5c07\u554f\u984c\u5206\u6210\u5169\u500b\u985e\u5225\u6216\u4ee5\u4e0a\u7684\u554f\u984c\uff0c\u800c Logistic Regression \u662f\u4e00\u7a2e\u7528\u4f86\u89e3\u6c7a Binary Classification \u7684\u6a5f\u5668\u5b78\u7fd2\u6a21\u578b\u3002\u5b83\u4f7f\u7528 Sigmoid Function \u4f86\u9810\u6e2c Positive Class \u7684\u6a5f\u7387\uff0c\u4e26\u5c07 Decision Boundary \u7684\u9593\u9694\u503c\u8a2d\u5b9a\u70ba 0.5\uff0c\u4ee5\u4fbf\u66f4\u597d\u7684\u5206\u8fa8 0/1\u3002","permalink":"/learning/machine-learning/logistic-regression/"},{"id":"learning/machine-learning/index","title":"Machine Learning","description":"\u9019\u500b\u7b46\u8a18\u5c0d\u61c9 Coursera \u8ab2\u7a0b Machine Learning\u3002 \u8ab2\u7a0b\u7531 Andrew Ng \u6559\u6388\u4e3b\u8b1b\uff0c\u662f\u4e00\u500b\u975e\u5e38\u597d\u7684\u6a5f\u5668\u5b78\u7fd2\u5165\u9580\u8ab2\u7a0b\u3002","permalink":"/learning/machine-learning/"},{"id":"learning/deep-learning/neural-networks-and-deep-learning/neural-networks-and-deep-learning","title":"Neural Networks and Deep Learning","description":"\u5728\u300aNeural Networks and Deep Learning\u300b\u4e2d\uff0c\u6211\u5011\u5c07\u5b78\u7fd2\u6df1\u5ea6\u5b78\u7fd2\u7684\u57fa\u790e\uff1a\u77ad\u89e3\u6df1\u5ea6\u5b78\u7fd2\u7684\u4e3b\u6d41\u6280\u8853\u3001\u80fd\u5920\u69cb\u5efa\u3001\u8a13\u7df4\u548c\u61c9\u7528 fully-connected \u7684\u6df1\u5ea6\u795e\u7d93\u7db2\u8def (DNN)\u3001\u77ad\u89e3\u5982\u4f55\u5be6\u73fe\u5411\u91cf\u5316\u795e\u7d93\u7db2\u8def\u4ee5\u53ca\u4e86\u89e3\u795e\u7d93\u7db2\u8def\u67b6\u69cb\u7684\u95dc\u9375\u53c3\u6578\uff0c\u9019\u4e5f\u662f\u6df1\u5ea6\u5b78\u7fd2\u5fc5\u4fee\u7684\u7b2c\u4e00\u5802\u8ab2\uff01","permalink":"/learning/deep-learning/neural-networks-and-deep-learning/"},{"id":"learning/intro","title":"\u5b78\u7fd2\u7b46\u8a18","description":"\u7cfb\u7d71\u6027\u7b46\u8a18\u53ef\u4ee5\u66f4\u5bb9\u6613\u5730\u638c\u63e1\u3001\u7406\u89e3\u548c\u61c9\u7528\u7db2\u8def\u4e0a\u7684\u8cc7\u6e90\uff0c\u4f7f\u5b78\u7fd2\u66f4\u6709\u6548\u7387\u4e14\u66f4\u5168\u9762\uff0c\u63d0\u4f9b\u5c0d\u6709\u8208\u8da3\u7684\u4eba\u66f4\u597d\u7684\u5b78\u7fd2\u7d93\u9a57\u4e26\u7372\u5f97\u66f4\u591a\u66f4\u6df1\u5165\u7684\u77e5\u8b58\u3002","permalink":"/learning/intro"}]}')}}]);